import React from 'react';
import photo from './Images/default.jpg';
import team from './Images/Team.png';
import ayla from './Images/Ayla.png';
import emma from './Images/Emma.png';

function About() {
  const people = [
    { name: "Ayla Kim", introduction: "I’m a junior at Brown from New Jersey, concentrating in Behavioral Decision Sciences + Public Policy Economics! I’ve been on the FRN E-Board for a year now, having joined the organization as a volunteer driver my freshman year. My favorite hobby is (you guessed it) going for long drives.", image: ayla },
    { name: "Emma Weech", introduction: "Hey there! I'm Jane, passionate about design and user experience.", image: emma },
    { name: "Seth Peiris", introduction: "Hello, I'm Michael. I enjoy solving complex problems with elegant solutions.", image: photo },
    { name: "Alex Zeng", introduction: "Hi everyone! I'm Emily. I'm a nature enthusiast and an avid reader.", image: photo },
    { name: "Aliza", introduction: "Hi everyone! I'm Emily. I'm a nature enthusiast and an avid reader.", image: photo },
    { name: "Suzie Zhang", introduction: "Greetings! I'm David, a music lover and amateur chef.", image: photo },
    { name: "David Veloso", introduction: "Greetings! I'm David, a music lover and amateur chef.", image: photo },
    { name: "Athena Deng", introduction: "Greetings! I'm David, a music lover and amateur chef.", image: photo },
    { name: "Ran Zhao", introduction: "Greetings! I'm David, a music lover and amateur chef.", image: photo },
    { name: "Bailey Smoko", introduction: "Greetings! I'm David, a music lover and amateur chef.", image: photo },
    // Add more people as needed
  ];

  return (
    <div style={{ backgroundColor: "#f0f0f0", position: "relative" }}>
      <div style={{ overflow: "hidden" }}>
        <img src={team} alt="Team Photo" style={{ width: "100%", height: "auto", objectFit: "cover", objectPosition: "50% 25%", filter: "brightness(0.8)" }} /> {/* Team photo at the top */}
        <h1 style={{ position: "absolute", top: "12%", left: "50%", transform: "translate(-50%, -50%)", color: "white", fontSize: "60px" }}>OUR TEAM</h1>
      </div>
      <div style={{ display: "flex", justifyContent: "left" }}>
        <div style={{ maxWidth: "800px" }}>
          <p style={{ textAlign: "left", fontSize: "24px", fontWeight: "bold", lineHeight: "1.5", padding: "10px 0", marginLeft: "200px" }}>FRN BROWN TEAM:</p>
          <div style={{ display: "flex", flexWrap: "wrap", justifyContent: "left" }}>
            {people.map(person => (
              <div key={person.name} style={{ margin: "10px", display: "flex", alignItems: "center" }}>
                <img src={person.image} alt={person.name} style={{ width: "200px", height: "200px", borderRadius: "50%", marginLeft: "200px" }} />
                <div style={{ marginLeft: "20px" }}>
                  <h3>{person.name}</h3>
                  <p style={{ fontSize: "18px", lineHeight: "1.4" }}>{person.introduction}</p>
                </div>
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
}

export default About;
